import { Route, Switch } from "react-router-dom";
import Layout from "./components/layout/Layout";
import MainDashboard from "./pages/MainDashboard";
function App() {

  return (<Layout>
    <Switch>
      <Route path="" exact>
        <MainDashboard/>
      </Route>
      <Route path ="/dashboard">
        <Dashboard/>
      </Route>
    </Switch>

  </Layout>)
}

export default App;
